import React from 'react';
import cube from './Images/Cube.png'
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import './Aegis.css'
function AegisMaster(){
    return(
        <div>
           
            <h1 style={{textAlign: 'center'}}>Upgrade Aegis</h1>
            <h1 className="textStyle">Current Plan</h1>
            <img src={cube} alt="Cube" className="cubeStyle"></img>
            <p style={{textAlign: 'center'}}>$299.99</p>
      
        </div>
    )
}
export default AegisMaster;
